import itertools
p=''
kmers = []
for i in range(0,len(p)-3): kmers.append(p[i:i+4])


r = []

for i in itertools.combinations(['A','C','G','T','A','C','G','T','A','C','G','T','A','C','G','T'],4): r.append(i[0]+i[1]+i[2]+i[3])

aux = list(set(r))

aux.sort()

dic = {}

for i in aux:
  dic[i] = 0

for i in kmers: dic[i]+=1

r= ''
for i in aux: r+= str(dic[i])+' '

